import Login from './Login';
import React from 'react';
import Circle from './Circle';
import { blue } from '@material-ui/core/colors';
function HomeTab() {
  return (
    <div style={{position:"absolute",display:"flex",flexDirection:"column",alignItems:"center",width:"95vw",height:"95vh"}}>
        <div style={{position:"absolute",justifyContent:"center",alignItems:"center"}}>
            <div style={{fontSize:30,fontFamily:"system-ui"}}>Policy Manager</div>
            <div style={{fontSize:20,fontFamily:"sans-serif"}}>-Michael Askndafi-</div>
            <Circle/>
        </div>
    </div>
  );
}

export default HomeTab;
